{"source":{"uri":"features/checkout.feature","data":"#language: pt\n\nFuncionalidade: Realizar o checkout e concluir a compra\n    Sendo um cliente com os produtos escolhidos no carrinho\n    Quero realizar o checkout \n    Para que eu possa finalizar a compra\n\n    Contexto: \n        Dado que estou logado como \"standard_user\" e \"secret_sauce\"\n            E filtro os produtos por preço crescente\n            E os produtos são mostrados com preço em ordem crescente\n            E adiciono os produtos \"Sauce Labs Onesie\" e \"Test.allTheThings() T-Shirt (Red)\" ao carrinho  \n            E o ícone do carrinho mostra a quantidade adicionada\n    \n    @carrinho\n    Cenario: Realizar o checkout\n        \n        E clico no ícone do carrinho\n        Quando clico no botão checkout\n        Então vou para a página de informações de entrega\n\n    @entrega\n    Cenario: Preencher o formulário de entrega e finalizar a compra\n\n        E clico no ícone do carrinho\n        E clico no botão checkout\n        E vou para a página de informações de entrega\n        Quando preencho o formulário com nome \"Marcos\", ultimo nome \"Soares\" e cep \"09175360\"\n            E confirmo as informações\n        Então a compra é finalizada \n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/login.feature","data":"#language: pt\n\nFuncionalidade: Realizar Login\n    Sendo um cliente cadastrado no e-commerce\n    Quero realizar o login no site \n    Para que eu possa escolher os produtos para comprar\n\n    @login\n    Cenario: Realizar login\n\n        Dado que acesso a página principal do e-commerce\n        Quando submeto minhas credenciais com \"standard_user\" e \"secret_sauce\" \n        Então sou redirecionado para a página de produtos\n\n    @login\n    Esquema do Cenario: Tentativa de login\n        Dado que acesso a página principal do e-commerce\n        Quando submeto minhas credenciais com \"<username_input>\" e \"<password_input>\"        \n        Então vejo a mensagem de alerta: \"<mensagem_output>\"\n    Exemplos:\n    |username_input |password_input|mensagem_output                                                          |\n    |standard_user  |#secret_sauce |Epic sadface: Username and password do not match any user in this service|\n    |locked_out_user|secret_sauce  |Epic sadface: Sorry, this user has been locked out.                      |\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/produtos.feature","data":"#language: pt\n\nFuncionalidade: Filtrar e selecionar produtos\n    Sendo um cliente cadastrado no e-commerce\n    Quero realizar o login no site \n    Para que eu possa escolher os produtos e comprar\n\n    Contexto:\n        Dado que estou logado como \"standard_user\" e \"secret_sauce\"\n\n    @ordenar\n    Cenario: Ordenar produtos por preço crescente\n\n        Quando filtro os produtos por preço crescente\n        Então os produtos são mostrados com preço em ordem crescente\n\n    @adicionar\n    Cenario: Adicionar produtos ao carrinho\n\n        E filtro os produtos por preço crescente\n        E os produtos são mostrados com preço em ordem crescente\n        Quando adiciono os produtos \"Sauce Labs Onesie\" e \"Test.allTheThings() T-Shirt (Red)\" ao carrinho  \n        Então o ícone do carrinho mostra a quantidade adicionada\n","mediaType":"text/x.cucumber.gherkin+plain"}},
